- input: "TEXT\x1CC00485821\x1CT1\x1C\x1CF3XA\x1C\"This Amendment has been filed in
    response to an RFAI dated March 9, 2011. The items raised are addressed by the
    RFAI's item numbers. (1) The Committee made independent expenditures referenced
    in the RFAI to Biz-Goods LLC on August 23 in the amount of $1,100, and on September
    9 in the amount of $885. The Committee should have filed 48-Hour notices on these
    expenditures as independent expenditures had already aggregated over $10,000 at
    the time they were made. The Committee will endeavor to improve its independent
    expenditure reporting in the future. These two expenditures make up less than
    1 percent of total indpendent expenditures for the quarter. (2) The Committee
    reported a number of expenditures on Schedule B, principally related to fundraising.
    These expenditures were for the Committee's own fundraising efforts and were not
    made on behalf of any specifically identified federal candidates, so no additional
    information is required on either Schedule B or Schedule E. (3) The Committee
    made a number of expenditures related to promotional activities, advertising,
    and media. These expenditures neither included express advocacy nor referred to
    any clearly identified Federal candidate. All were related to the grassroots activities
    of the Committee and its efforts to raise funds and recruit volunteers to support
    that activity. These expenditures were properly reported on Schedule B. In addition
    to the issues raised in the RFAI relating to this report, a review of the Committee's
    records to prepare responses to RFAIs for subsequnet reports revealed a significant
    data entry error that resulted in the under-reporting of receipts. The Committee
    received contributions through a number of different channels. In an effort to
    track online contributions received through one of the Committee's websites, a
    special account code was created in the Committee's reporting software. Because
    of the way the account code was created, contributions received through this channel
    were not reported. The Committee has corrected the data entry error and this report
    details all of the Committee's receipts for the relevant period. This accounts
    for the increase of about $45,000 in receipts between the original report and
    this amended report. Additionally, the Committee discovered that the accounting
    records provided by one of its online credit card processing vendors included
    details of contribution refunds in footnotes. The Committee did not initially
    report these refunds. This error has been corrected on this amended report.\"\n"
